export async function importCompetitorsFromCSV(
  spaceId: string,
  serviceId: string,
  file: File
): Promise<{
  success: boolean
  message: string
  imported?: number
  errors?: Array<{ row: number; message: string }>
}> {
  try {
    const BASE_URL = import.meta.env.VITE_BACKEND_API_URL || 'http://localhost:8080/api'
    const url = `${BASE_URL}/spaces/${spaceId}/services/${serviceId}/competitors/import`

    // Get Firebase auth token
    const { auth } = await import('@/utils/firebaseConfig')
    const token = await auth.currentUser?.getIdToken()

    if (!token) {
      throw new Error('Authentication required')
    }

    // Get CSRF token for security
    const csrfToken = await csrfManager.getToken()

    const formData = new FormData()
    formData.append('file', file)

    const response = await fetch(url, {
      method: 'POST',
      headers: {
        Authorization: `Bearer ${token}`,
        'X-CSRF-Token': csrfToken,
      },
      credentials: 'include',
      body: formData,
    })

    const data = await response.json()

    if (!response.ok) {
      throw new Error(data.message || 'Import failed')
    }

    return data
  } catch (error) {
    console.error('CSV import error:', error)
    throw error
  }
}

